// SPDX-License-Identifier: MIT

pragma solidity ^0.8.22;

struct collateral {
    uint amount;
    uint ratio;
    bool cannotLoan;
}

contract Loan {
    // In Solidity, the default value for an uninitialized state variable of type address is address(0)
    mapping (address => collateral) _collateralAsset;
    mapping (address => uint) _loan;

    // event LoanRepaid(uint amount);


    function loan(uint collateralOver) public payable{
        require(_collateralAsset[msg.sender].cannotLoan == false, "you must be return asset that borrow first");
        require(collateralOver >= 150 && collateralOver <= 300, "require collateral between 150 and 300%.");
        require(msg.value >= 100000000000000000, "Ether must greater than equal 0.1");

        _collateralAsset[msg.sender] = collateral(msg.value, 100*(10**2)/collateralOver, true);
        uint loanAmount = (_collateralAsset[msg.sender].amount * _collateralAsset[msg.sender].ratio) / (10**2);
        _loan[msg.sender] = loanAmount;
        payable(msg.sender).transfer(_loan[msg.sender]);
    }

    function repayLoan() external payable{
        require(_loan[msg.sender] == msg.value, "Repayment amount must be equal your loan");

        payable(msg.sender).transfer(_collateralAsset[msg.sender].amount);
        _collateralAsset[msg.sender].amount = 0;
        _collateralAsset[msg.sender].ratio = 0;
        _collateralAsset[msg.sender].cannotLoan = false;
       
        

        // emit LoanRepaid(msg.value);
    }

